import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
       <div className="wrapper">         
          <div className="input-wrapper">
            <input/>
            <button>+</button>
          </div>
         </div> 
      </header>
    </div>
  );
}

export default App;
